CREATE TABLE hospitals (
  hospital_code INT PRIMARY KEY, 
  name VARCHAR(100),
  location VARCHAR(100)
);
CREATE TABLE users_inoffice (
  id int not null,
  full_name VARCHAR(50) NOT NULL,
  username VARCHAR(50) NOT NULL, 
  password VARCHAR(255) NOT NULL,
  role ENUM('admin','employee') NOT NULL,
  created_at TIMESTAMP NOT NULL DEFAULT current_timestamp(),
  hospital_code INT,
  PRIMARY KEY (username), 
  CONSTRAINT FK_Users_office FOREIGN KEY (hospital_code) REFERENCES hospitals(hospital_code)
);

CREATE TABLE users (
  id int not null,
  full_name VARCHAR(50) NOT NULL,
  username VARCHAR(50) NOT NULL, 
  password VARCHAR(255) NOT NULL,
  role ENUM('admin','employee') NOT NULL,
  created_at TIMESTAMP NOT NULL DEFAULT current_timestamp(),
  hospital_code INT,
  PRIMARY KEY (username), 
  CONSTRAINT FK_Users_Hospitals FOREIGN KEY (hospital_code) REFERENCES hospitals(hospital_code)
);

CREATE TABLE user_hospitals (
  username VARCHAR(50), 
  hospital_code INT,
  PRIMARY KEY (username, hospital_code),
  FOREIGN KEY (username) REFERENCES users(username) ON DELETE CASCADE,
  FOREIGN KEY (hospital_code) REFERENCES hospitals(hospital_code) ON DELETE CASCADE
);



CREATE TABLE Devices(
	Floor VARCHAR(50) NULL,
	Department VARCHAR(50) NULL,
  Department_now VARCHAR(50) NULL,
	Room VARCHAR(50) NULL,
  device_name VARCHAR(150) NULL,
  Accessories VARCHAR(50) NULL,
  Manufacturer VARCHAR(50) NULL,
  Origin VARCHAR(50) NULL,
  Company VARCHAR(50) NULL,
  Model VARCHAR(50) NULL,
  Serial_number VARCHAR(50) NOT NULL,
  QT INT NULL,
  BMD_Code VARCHAR(50) NULL,
  Arrival_Date DATE NULL,
  Installation_Date DATE NULL,
  purchaseorder_date DATE NULL,
  Price VARCHAR(50) NULL,
  Warranty_Period INT NULL,
  warranty_start DATE NULL,
  warranty_end DATE NULL,
  company_contact VARCHAR(50) NULL,
  company_Tel VARCHAR(50) NULL,
  hospital_code INT ,
  assigned_user VARCHAR(50) NOT NULL,
  device_safety_test VARCHAR(50),
  device_user_tranning VARCHAR(50),
  device_BME_tranning VARCHAR(50),
	CONSTRAINT PK_Devices PRIMARY KEY CLUSTERED (serial_number ASC),
	CONSTRAINT FK_Devices_Hospitals FOREIGN KEY (hospital_code) REFERENCES hospitals(hospital_code),
	CONSTRAINT FK_Devices_Users FOREIGN KEY (assigned_user) REFERENCES users(username) 
);


CREATE TABLE workorders (
  id VARCHAR(50) PRIMARY KEY,
  device_serial VARCHAR(50),
  device_name VARCHAR(200),
  requested_by VARCHAR(50),
  department VARCHAR(50),
  date_recevied VARCHAR(50),
  time_recevied VARCHAR(50),
  issue_description VARCHAR(200),
  repair_description VARCHAR(200),
  inhouse_fixed_by VARCHAR(100),
  contacted_manufacturer VARCHAR(10),
  outhouse_fixed_by VARCHAR(100),
  repair_cost VARCHAR(100),
  repair_type VARCHAR(100),
  used_spare_parts VARCHAR(10),
  status VARCHAR(50) DEFAULT 'open',
  start_date DATE  NOT NULL,
   start_time VARCHAR(50)  NOT NULL,
    end_date DATE  NOT NULL,
	 end_time VARCHAR(50)  NOT NULL,
  downtime_duration INT,
  created_by VARCHAR(50),
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,

  FOREIGN KEY (device_serial) REFERENCES Devices(serial_number),
  FOREIGN KEY (created_by) REFERENCES users(username)
);


CREATE TABLE spare_parts_used (
  part_id INT PRIMARY KEY,
  workorder_id VARCHAR(50),
  part_name VARCHAR(255),
  quantity INT DEFAULT 1,
  note TEXT,

  FOREIGN KEY (workorder_id) REFERENCES workorders(id)
);


CREATE TABLE Manufacturer (
     manufacturer_name VARCHAR(255) PRIMARY KEY,
	 contact_name VARCHAR(100),
	 contact_title VARCHAR(100),
	 phone VARCHAR(20),
	 contact_mobile VARCHAR(100),
	 contact_email VARCHAR(100),
	 note VARCHAR(255),
	 hospital_code INT NOT NULL,
     created_by VARCHAR(50) NOT NULL,
	 FOREIGN KEY (created_by) REFERENCES users(username),
	 FOREIGN KEY (hospital_code) REFERENCES hospitals(hospital_code)
);


CREATE TABLE company (
     company_name VARCHAR(255) PRIMARY KEY,
	 phone VARCHAR(20),
	 company_address  VARCHAR(100),
	 company_email  VARCHAR(100),
	 contact1_name VARCHAR(100),
	 contact1_title VARCHAR(100),
	 contact1_mobile VARCHAR(100),
	 contact1_email VARCHAR(100),
	 contact2_name VARCHAR(100),
	 contact2_title VARCHAR(100),
	 contact2_mobile VARCHAR(100),
	 contact2_email VARCHAR(100),
	 contact3_name VARCHAR(100),
	 contact3_title VARCHAR(100),
	 contact3_mobile VARCHAR(100),
	 contact3_email VARCHAR(100),
	 note VARCHAR(255),
	 hospital_code INT NOT NULL,
  created_by VARCHAR(50) NOT NULL,
	 FOREIGN KEY (created_by) REFERENCES users(username),
	 FOREIGN KEY (hospital_code) REFERENCES hospitals(hospital_code)
);

CREATE TABLE invoices (
   id INT PRIMARY KEY AUTO_INCREMENT,
   company_name VARCHAR(255),
   invoice_date DATE NULL,
   device_serial VARCHAR(50),
   device_name VARCHAR(150),
   qt INT,
   price VARCHAR(50) NULL,
  FOREIGN KEY (company_name) REFERENCES company(company_name),
   FOREIGN KEY (device_serial) REFERENCES Devices(serial_number)
);

 CREATE TABLE purchasing_order  (
      id int PRIMARY KEY AUTO_INCREMENT,
     device_name VARCHAR(150),
	 company_name VARCHAR(255),
	 purchasing_order_date  DATE  NOT NULL,
	  qt int,
	  price VARCHAR(50) ,
	    FOREIGN KEY (company_name) REFERENCES company(company_name)
	);


CREATE TABLE preventive_maintenance_plan (
  id INT AUTO_INCREMENT PRIMARY KEY,
  device_name VARCHAR(255),
  quantity INT,
  num_of_pm INT,
  total_pm INT,
  month_1 BOOLEAN,
  month_2 BOOLEAN,
  month_3 BOOLEAN,
  month_4 BOOLEAN,
  month_5 BOOLEAN,
  month_6 BOOLEAN,
  month_7 BOOLEAN,
  month_8 BOOLEAN,
  month_9 BOOLEAN,
  month_10 BOOLEAN,
  month_11 BOOLEAN,
  month_12 BOOLEAN,
  calibration_month INT,
  hospital_code INT,
  CONSTRAINT FK_pm_Hospitals FOREIGN KEY (hospital_code) REFERENCES hospitals(hospital_code)
);

 CREATE TABLE calibration  (
     id int PRIMARY KEY AUTO_INCREMENT,
      plan_id INT NOT NULL,
	 device_serial VARCHAR(50),
     device_name VARCHAR(150),
	 model VARCHAR(50),
	 department VARCHAR(50),
  calibration_date DATE NOT NULL,
	 en_name VARCHAR(50),
	 FOREIGN KEY (device_serial) REFERENCES Devices(serial_number),
     FOREIGN KEY (plan_id) REFERENCES preventive_maintenance_plan(id)
	 );

  SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

-- notifications table
CREATE TABLE `notifications` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `message` text NOT NULL,
  `recipient` int(11) NOT NULL,
  `type` varchar(50) NOT NULL,
  `date` date NOT NULL DEFAULT current_timestamp(),
  `is_read` tinyint(1) DEFAULT 0,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

